import React from "react";
import professors from "./RatingsData";
import Ratings from './Ratings';

function Faculty(){
    console.log(professors)
    return(
        <>
            {professors.map((r) => (
                <Ratings key = {r.id} professor = {r}></Ratings>
            ))
            }
        </>
    )
}
export default Faculty
